var GameConfig;
(function (GameConfig) {
    //当前舞台
    function curStage() {
        return egret.MainContext.instance.stage;
    }
    GameConfig.curStage = curStage;
    //当前游戏宽度
    function curWidth() {
        return egret.MainContext.instance.stage.stageWidth;
    }
    GameConfig.curWidth = curWidth;
    //当前游戏宽度
    function curHeight() {
        return egret.MainContext.instance.stage.stageHeight;
    }
    GameConfig.curHeight = curHeight;
    //游戏界面居中显示
    function stageOffsetY() {
        var offsetY = (this.stage.stageHeight - 1280) / 2;
        if (offsetY < 0) {
            offsetY = 0;
        }
        return offsetY;
    }
    GameConfig.stageOffsetY = stageOffsetY;
    function injectConfig(config) {
        if (config.http_type == "test") {
            this.httpServerBaseURL = "https://wedev.openpoker.cn";
        }
        else if (config.http_type == "online") {
            this.httpServerBaseURL = "https://wechat.openpoker.cn";
        }
        else if (config.http_type == "local") {
            // this.httpServerBaseURL = "http://192.168.3.100:9118";
            this.httpServerBaseURL = "http://192.168.3.248:9118";
            // this.httpServerBaseURL = "http://tq.woaipoker.com";
        }
        if (config.sockect_type == "test") {
            this.socketBaseURL = "wss://wsballtest.openpoker.cn";
        }
        else if (config.http_type == "online") {
            this.socketBaseURL = "wss://wsball.openpoker.cn";
        }
        else if (config.http_type == "local") {
            // this.socketBaseURL = "ws://192.168.3.100:8888";
            this.socketBaseURL = "ws://192.168.3.248:8888";
            // this.socketBaseURL = "wss://tq.woaipoker.com";
        }
        this.channelId = config.channel_id;
        this.appid = config.appid;
        this.wxAppId = config.wxAppId;
        this.gameVer = config.version;
        this.gameType = config.gameType;
        this.gameName = config.desc;
        this.appKey = config.appKey;
        if (config.adId) {
            this.adId = config.adId;
        }
        if (config.bannerAdId) {
            this.bannerAdId = config.bannerAdId;
        }
        if (config.lobby == false) {
            this.openLobby = false;
        }
        if (config.testUid) {
            this.testUid = config.testUid;
        }
        shareInfo = config.shareInfo;
    }
    GameConfig.injectConfig = injectConfig;
    GameConfig.openLobby = false;
    GameConfig.httpServerBaseURL = "";
    GameConfig.socketBaseURL = "";
    GameConfig.channelId = "";
    GameConfig.appid = 0;
    GameConfig.testUid = "";
    GameConfig.gameName = "";
    GameConfig.gameVer = 1;
    GameConfig.soundSwitch = true; //是否打开声音
    GameConfig.vibrateSwitch = true; //是否震动
    GameConfig.languageType = 'en'; //语言环境
    GameConfig.showTips = true; //显示新手引导
    var GameMode;
    (function (GameMode) {
        GameMode[GameMode["TIME"] = 1] = "TIME";
        GameMode[GameMode["ENDLESS"] = 2] = "ENDLESS";
        GameMode[GameMode["CLIMB"] = 3] = "CLIMB";
    })(GameMode = GameConfig.GameMode || (GameConfig.GameMode = {}));
    GameConfig.gameMode = GameMode.TIME;
    /**
     * 微信广告id
     */
    GameConfig.adId = "";
    GameConfig.bannerAdId = "";
    /**
     * 微信分配的appid
     */
    GameConfig.wxAppId = "";
    /**
     * 平台分配的appKey
     */
    GameConfig.appKey = "";
    /**
     * 渠道类型
     */
    GameConfig.gameType = "";
    // 游戏KEY
    GameConfig.key = '';
    // 游戏自定义ID
    GameConfig.appCode = 1;
    //分享信息
    var shareInfo = [];
    var shareIdx = 0;
    function getKey() { return this.key; }
    GameConfig.getKey = getKey;
    ;
    function getAppCode() { return this.appCode; }
    GameConfig.getAppCode = getAppCode;
    ;
    function getShareInfo() {
        var idx = core.MathUtils.random(0, 3);
        return { title: shareInfo[idx].title, image: shareInfo[idx].url, iconId: idx };
    }
    GameConfig.getShareInfo = getShareInfo;
    GameConfig.openGUI = false;
    GameConfig.openMatterDebugger = false;
    window["game_config"] = {};
    window["game_config"].logoBase64 = "data:image/png;base64,";
})(GameConfig || (GameConfig = {}));
